window.bookSummaryJSON = "<p><b>Cursed from birth. Forced into slavery. It's time to fight back.</b>&nbsp;</p> <p>The blood of the Ancients is the most coveted ingredient in all of Damaris. The fabled elixir made from it grants those who drink it life that extends far beyond natural means.&nbsp;</p> <p>There is no higher honor in the kingdom then being granted the privilege of bidding for it. And the people found with the cursed blood? By law, they are the rightful property of the kingdom.&nbsp;</p> <p>They are tributes.&nbsp;</p> <p>As a boy, Ryl was sold by his family when he was discovered to have the coveted blood flowing through his veins. Broken, scared, and confused, heâ€™s confined to an area known as the Stocks until he is ready for harvesting.&nbsp;</p> <p>Ryl stumbles through a doomed life until the appearance of a mysterious stranger who exposes a buried version of the past that changes everything. That his blood may not be a curse, but a blessing.&nbsp;</p> <p>The fates of all the tributes hang in the balance.&nbsp;</p> <p><b>Experience the start of an epic fantasy series filled with unexpected heroes, dark magic, and nonstop adventure. Suitable for all ages, it's perfect for fans of D K. Holmberg, Will Wight, and K. F. Breene.</b></p>"; 
